import React from "react";
import ReactDOM from "react-dom";
import Main from "./Main";
import "./index.css";
import { StrictMode } from "react";
import App from "./App";

ReactDOM.render(
  <Main/>, 
  document.getElementById("root")
);


const rootElement = document.getElementById("root");
ReactDOM.render(
  <StrictMode>
    <App />
  </StrictMode>,
  rootElement
);
